import React from "react";
import Header from "./Header.jsx";
import Footer from "./Footer.jsx";
import Note from "./Note.jsx";
import Content from "./Content.js";

console.log(Content);

function App(){
  return(
    <div>
    <Header />
    <CreateArea />
    {Content.map( data => {
      return(
        <Note
          key = {data.key}
          title = {data.title}
          content = {data.content}
        />
      );
    }) };
    <Footer />
    </div>
  );
}

export default App;
